import React from 'react';
import { FinancialData } from '../types';

interface DataTableProps {
    data: FinancialData[];
}

const DataTable: React.FC<DataTableProps> = ({ data }) => {
    return (
        <div className="overflow-x-auto">
            <table className="min-w-full divide-y divide-gray-200">
                <thead className="bg-gray-50">
                    <tr>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Date</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Revenue</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Net Income</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Gross Profit</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">EPS</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Operating Income</th>
                    </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                    {data.map((item) => (
                        <tr key={item.date}>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">{item.date}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">{item.revenue}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">{item.netIncome}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">{item.grossProfit}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">{item.eps}</td>
                            <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">{item.operatingIncome}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};
